import React from 'react'
import styled from 'styled-components'

const HeaderWrapper = styled.header`
  width: 100vw;
  height: 60vh;

  display: grid;
  grid-template-columns: 1fr 1fr;
`

const Text = styled.div`
  align-self: center;
`

const Image = styled.div`
  align-self: center;
`

const Title = styled.h1`
  font-size: 3.5rem;
  white-space: nowrap;
`
const SubTitle = styled.p``

const Header = () => {
  return (
    <HeaderWrapper>
      <Text>
        <Title>
          Get You Some <br />
          Shortened Links
        </Title>
        <SubTitle>Secure and reliable short links. Via rel.ink api.</SubTitle>
      </Text>
      <Image>
        <img src='/goochIcon.png' alt='gooch icon' />
      </Image>
    </HeaderWrapper>
  )
}

export default Header
